import React, { useState } from "react";

export const Faq = () => {
  const [questions, setQuestions] = useState([
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
  ]);

  const [toogle, setToggle] = useState(false);
  return (
    <section className="">
      <div className="text-center">
        <h1>FAQS</h1>
        <p>Have any questions? Here are answers to some of them</p>
      </div>

      <div className=" mx-auto w-faqWidth">
        {questions.map((question) => (
          <div>
            <div className="border-first p-3 mb-1 flex justify-between">
              <p>{question.title}</p> <p className="text-2xl">+</p>
            </div>
            <div className="border-first mb-5 p-4 flex justify-between">
              <p>{question.comment}</p> <p className="text-2xl">-</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};
